import { Grid } from "@material-ui/core";

function Home(){

    let nome: String = "pedro";
    return(
        <div>
            <Grid container spacing={3}>
                <Grid item xs={6}>
                <h1>Teste de Home com {nome}</h1>
                </Grid>
                <Grid item xs={6}>
                <h2>Teste de material GRID</h2>
                </Grid>
            </Grid>
        </div>
    );
}

export default Home;
